Descansamos un poco del mundo de los TADs para ver una característica de C++ que no se encuentra en otros lenguajes orientados a objetos. C++ nos permite personalizar la forma en la que se inicializa un objeto a partir de otro. Para ello tenemos que implementar el constructor de copia: ▶️ C++ - Constructores de copia (8:39) 📄 Código fuente 📝 Ejercicio 2.6 Las implementaciones del TAD Lista que hemos visto hasta ahora piden a gritos un constructor de copia, para evitar compartición no deseada. Es tu turno: ¿puedes implementarlo en ambas? 💻 Añadir constructor de copia a implementación mediante arrays 💻 Añadir constructor de copia a implementación mediante listas enlazadas En el siguiente vídeo se muestra una posible forma de implementar el constructor de copia para los TAD vistos hasta ahora: ▶️ Constructores de copia en el TAD Lista (3:04) 📄 Código fuente (implementación mediante vectores) 📄 Código fuente (implementación mediante listas enlazadas) ℹ️ Información adicional sobre Java (opcional) En Java existe el constructor de copia como tal, pero es tratado como un constructor cualquiera. Por ejemplo, supongamos la siguiente clase: class MiClase { ... } Si asignamos un objeto c1 a un objeto c2, MiClase c1 = new MiClase();
MiClase c2 = c1; en realidad estamos haciendo que c2 apunte al mismo objeto que c1. Es decir, en Java no se llama a ningún constructor de copia. Es posible implementar un constructor de copia en Java, declarándolo como un constructor que recibe otra instancia de MiClase. class MiClase { public MiClase() {/* constructor por defecto */} public MiClase(MiClase other) {/* constructor de copia */} // ...
} En este caso, tendríamos que llamar al constructor explícitamente para hacer uso de él MiClase c1 = new MiClase();
MiClase c2 = new MiClase(c1); // Llama al constructor de copia Una alternativa al constructor de copia en Java es la clase Cloneable y el método clone() de la clase Object.

