Vamos a tomarnos un descanso de engarzar punteros entre los nodos de una lista enlazada para presentar una característica interesante de C++: la sobrecarga de operadores. Esta característica también se encuentra en otros lenguajes de programación (Python, C#, Lua, etc.), pero no en Java. ▶️ ️ C++ - Sobrecarga de operadores (12:35) 📄 Código fuente En una de las diapositivas del vídeo anterior aparecía la lista de operadores sobrecargables. Entre ellos estaba el operador =. Hay que prestar atención a este operador, porque a veces vamos a tener que sobrecargarlo si no queremos que nuestras clases tengan comportamientos inesperados. ¿Qué es lo que hace el operador =?. Ya lo conocéis desde el año pasado. Si tenemos lo siguiente: int x;
x = 2 + 4; El operador = evalúa lo que tiene a su lado derecho (2 + 4) y sobreescribe el valor de la variable del lado izquierdo con el resultado de la evaluación. Ahora bien ¿Qué pasa si yo hago una asignación de un registro a otro? struct Punto { int x; int y;
};
// ...
Punto p1;
p1.x = 1;
p1.y = 2;
Punto p2;
p2 = p1; // <-- Asignación de p1 a p2 Por defecto, y salvo que indiquemos lo contrario, el operador = asigna el valor del campo p1.x a p2.x y similarmente con p1.y. El código sería equivalente al siguiente: struct Punto { int x; int y;
};
// ...
Punto p1;
p1.x = 1;
p1.y = 2;
Punto p2;
p2.x = p1.x; // <-- Asignación del atributo x de p1 al atributo x de p2
p2.y = p1.y; // <-- Asignación del atributo y de p1 al atributo x de p2 El transferir la información, atributo por atributo, de un objeto a otro puede ser razonable en muchos casos, pero no en otros. Este problema ya lo hemos tenido la semana pasada con el constructor de copia. Si uno de los atributos del objeto a copiar es un puntero a otro, no me interesa copiar el puntero sin más, sino hacer una copia del contenido apuntado por ese puntero. Estos problemas y otros similares son el objeto del siguiente vídeo: ▶️ ️ C++ - Operador de asignación (12:19) 📄 Código fuente 📝 Ejercicio 3.5 En el siguiente cuestionario podrás repasar lo visto en el vídeo anterior: ❓ Cuestionario de autoevaluación - Sobrecarga de operadores Ya que hemos aprendido cómo se sobrecargan operadores, vamos a ver cómo podemos aplicar la sobrecarga a las clases del TAD lista que hemos creado hasta ahora. En particular, vamos a sobrecargar los operadores de desplazamiento (<<), indexación ([]) y asignación (=). ▶️ Sobrecargando operadores en el TAD Lista (8:01) Las implementaciones de nuestras versiones del TAD Lista quedan del siguiente modo: 📄 Código fuente (TAD Lista mediante arrays) 📄 Código fuente (TAD Lista mediante listas enlazadas simples) 📄 Código fuente (TAD Lista mediante listas doblemente enlazadas circulares)

