Esta semana comenzamos con un nuevo tipo abstracto de datos para almacenar colecciones de elementos: el TAD Conjunto. Para ello, utilizamos el enfoque de siempre: identificamos un modelo al que se le asocian un conjunto de operaciones. ▶️ El TAD Conjunto - operaciones (6:18) Es esencial conocer la diferencia entre los conjuntos y las listas. Existen varias propiedades que los diferencian. En primer lugar, el contenido de una lista depende del orden en el que insertemos los elementos. Esto implica que los dos fragmentos de programa que aparecen a continuación no son equivalentes: Programa 1 list<int> l;
l.push_back(1);
l.push_back(2); Programa 2 list<int> l;
l.push_back(2);
l.push_back(1); Por el contrario, en los conjuntos, las inserciones son intercambiables. Los fragmentos que vas a ver a continuación sí son semánticamente equivalentes: Programa 1 set<int> s;
s.insert(1);
s.insert(2); Programa 2 set<int> s;
s.insert(2);
s.insert(1); Otra propiedad que disfrutan los conjuntos, pero no las listas, es el hecho de que la operación de inserción es idempotente. Es decir, los siguientes fragmentos son semánticamente equivalentes: Programa 1 set<int> s;
s.insert(1);
s.insert(1); Programa 2 set<int> s;
s.insert(1); Con las listas no ocurre lo mismo. Si se añade un mismo elemento dos veces al final de una lista, la lista contendrá ambas apariciones del mismo elemento.
